import React from 'react';
import Card from './Card.js';
import SourceData from './Sourcedata.js';

const CardList = (props) => {
    return (
        <div class="row">
            <Card {...SourceData[0]} />
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
        </div>
    )
}

export default CardList;
